import React from "react";

function T(){
  return new Date().toLocaleTimeString()
}

setInterval(T,1000)
export default function Home() {
  return (
    <>
      <h2>Welcome to Garmin Dashboard</h2>
      <p>Time is {T()}</p>
      <p>Athlete name:</p>
      <p>Other info:</p>
      <img src="/finance-chart.jpg" width="100%" alt="finance chart"/>
    </>
  )
}
